package com.company.easy._392;

/**
 * Description
 * <p>
 *     https://leetcode-cn.com/problems/is-subsequence/
 * </p>
 * DATE 2020/2/9.
 *
 * @author genglintong.
 */
public class Solution {
    public boolean isSubsequence(String s, String t) {
        char[] chars_S = s.toCharArray(), chars_T = t.toCharArray();
        int lenS = chars_S.length, startS = lenS, startT = 0, lenT = chars_T.length;

        while (startS > 0) {
            while (startT < lenT && chars_S[lenS - startS] != chars_T[startT]) {
                startT++;
            }

            startT++;
            startS--;

            if (startT  > lenT) return false;
        }

        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.isSubsequence("abc", "ahbgdc"));
        System.out.println(solution.isSubsequence("axc", "ahbgdc"));
        System.out.println(solution.isSubsequence("leeeeetcode", ""));
    }
}
